import React from 'react';

function EnlistButton({ bot, addBotToArmy }) {
  return (
    <button onClick={() => addBotToArmy(bot)} style={{ cursor: 'pointer', color: 'blue' }}>
      Enlist
    </button>
  );
};

export default EnlistButton;
